select
  min(rowid) from_rowid,
  max(rowid) to_rowid
from (
  select rowid,
    ntile(${bckts}) over(order by rowid) bucket
  from ${table_name} PARTITION where ${where_clause}
)
group by bucket
order by bucket

select
  min(rowid) from_rowid,
  max(rowid) to_rowid
from (
  select rowid,
    ntile(${bckts}) over(order by rowid) bucket
  from ${table_name} PARTITION where ${where_clause} 
  and  ${less_than_clause:replace('%MAX_VALUE%',${max_value})} and ${greater_than_clause:replace('%PRE_MAX_VALUE%',${pre_max_value})}
)
group by bucket
order by bucket

